import React from 'react'

class Myclass extends React.PureComponent
{
    
    //class properties
     id=1001;
     email="abhi@gmail.com"



    //constructor
    constructor(props)
    {
       super(props);
    }

    myfun()
    {
        return "this is own function <br />"
    }

     // prepare the component input
    render()
    {

           return(<>
        
          <div className="container p">

          <h1>RECT CLASS COMPONENT</h1>
           {this.id}-{this.email}-{this.myfun()}

          </div>

           </>);

    }
}

export default Myclass
